import React from 'react';
import { View, Text, TouchableOpacity, Image, StyleSheet } from 'react-native';

export default function itens() {
 return (
   
   <TouchableOpacity>
     <Image
     source={require('../../images/kimono_frente_preto.jpeg')}
     style={styles.itensImg}
     />
     <Text style={styles.itensText}>
        Kimono Preto Longo
     </Text>
   </TouchableOpacity>
  );
}

const styles = StyleSheet.create({
  container:{
    marginLeft: '2%',
    paddingVertical: '2%',
    alignItems: 'center',
    justifyContent: 'center'
  },

  itensImg:{
    marginHorizontal: '30%',
    marginTop: '5%',
    width: 150,
    height: 150,
  }, 

  itensText:{
    marginHorizontal: '30%',
    fontSize: 16,
    alignSelf: 'center'

  }
});
